vector<Mutation> mutateSequence(string &sequence, double pm) {
    srand(unsigned(time(0)));

    vector<Mutation> mutations;
    int pos = 0;
    for (int i = 0, n = sequence.length(); i < n; i++) {
        double r = (double) rand() / RAND_MAX;

        if (r <= pm) {
            int mode = rand() % 3;
            switch (mode) {
                case 0: {
                    //supstitution
                    char replacement = symbols[rand() % 4];
                    sequence[pos] = replacement;
                    mutations.push_back(Mutation(MutationType::Substitution, 5440 + pos, replacement));
                    pos++;
                    break;
                }
                case 1: {
                    //deletion
                    sequence.erase(pos, 1);
                    mutations.push_back(Mutation(MutationType::Deletion, 5440+pos, '-'));
                    break;
                }
                case 2: {
                    //insertion
                    string insertion(1, symbols[rand() % 4]);
                    sequence.insert(pos, insertion);
                    mutations.push_back(Mutation(MutationType::Insertion, 5440+pos, insertion[0]));
                    pos += 2;
                    break;
                }
                default:
                    break;
            }
        } else {
            pos++;
        }
    }
    return mutations;
}
